@title IStudentRegistry
@dev Interface for the StudentRegistry contract.
Defines the functions available for interacting with the student registry.

@dev Register a student with the provided address, name, and age.
@param _studentAddr The address of the student to register.
@param _name The name of the student.
@param _age The age of the student.

@dev Update a student's information, including potentially changing their address.
@param _studentAddr The new address of the student.
@param _name The new name of the student.
@param _age The new age of the student.

@title MyStudentRegistry
@dev This contract acts as a proxy to interact with another StudentRegistry contract.
It forwards calls to the `StudentRegistry` contract for student management functions.

@dev Register a student by forwarding the call to the StudentRegistry contract.
@param _studentAddr The address of the student to register.
@param _name The name of the student.
@param _age The age of the student.
Requires exactly 1 ether to be sent with the transaction.

@dev Update a student's information by forwarding the call to the StudentRegistry contract.
@param _studentAddr The new address of the student.
@param _name The new name of the student.
@param _age The new age of the student.

@title Ownable
@dev This contract sets up an ownership system.
It allows for transferring ownership and restricting access to certain functions to the owner only.

@dev Change the owner of the contract to a new address.
@param _newOwner The address of the new owner.
Emits a {changedOwner} event.

@title StudentCounter
@dev This contract is used to manage and track student IDs.
It includes functions to get, increase, and decrease the student ID.

@title StudentRegistry
@dev This contract manages student registrations, authorization, and details.
It allows for student registration with payment, updating student information, and handling ownership.

@dev Register a student with a given address, name, and age.
Requires payment of exactly 1 ether.
@param _studentAddr The address of the student.
@param _name The name of the student.
@param _age The age of the student.

@dev Retrieve student information.
@param _studentAddr The address of the student.
@return The student details.

@dev Update student information.
Can change the address, name, or age of the student. Only the owner can update.
@param _studentAddr The new address of the student.
@param _name The new name of the student.
@param _age The new age of the student.

